In general, salsa's lazy validation scheme can lead to the accumulation of garbage that is no longer needed. Consider a query like this one: fn derived1(db: &impl Database, start: usize) { let middle = self.input(start); self.derived2(middle)
} Now imagine that, on some particular run, we compute derived1(22): derived1(22) executes input(22), which returns 44 then executes derived2(44) The end result of this execution will be a dependency graph like: derived1(22) -> derived2(44) | v
input(22) Now. imagine that the user modifies input(22) to have the value 45. The next time derived1(22) executes, it will load input(22) as before, but then execute derived2(45). This leaves us with a dependency graph as follows: derived1(22) -> derived2(45) | v
input(22) derived2(44) Notice that we still see derived2(44) in the graph. This is because we memoized the result in last round and then simply had no use for it in this round. The role of GC is to collect "outdated" values like this one. ###Review: Tracing and GC before durability In the absence of durability, when you execute a query Q in some new revision where Q has not previously executed, salsa must trace back through all the queries that Q depends on to ensure that they are still up to date. As each of Q's dependencies is validated, we mark it to indicate that it has been checked in the current revision (and thus, within a particular revision, we would never validate or trace a particular query twice). So, to continue our example, when we first executed derived1(22) in revision R1, we might have had a graph like: derived1(22) -> derived2(44)
[verified: R1] [verified: R1] | v
input(22) Now, after we modify input(22) and execute derived1(22) again, we would have a graph like: derived1(22) -> derived2(45)
[verified: R2] [verified: R2] | v
input(22) derived2(44) [verified: R1] Note that derived2(44), the outdated value, never had its "verified" revision updated, because we never accessed it. Salsa leverages this validation stamp to serve as the "marking" phase of a simple mark-sweep garbage collector. The idea is that the sweep method can collect any values that are "outdated" (whose "verified" revision is less than the current revision). The intended model is that one can do a "mark-sweep" style garbage collection like so: // Modify some input, triggering a new revision.
db.set_input(22, 45); // The **mark** phase: execute the "main query", with the intention
// that we wish to retain all the memoized values needed to compute
// this main query, but discard anything else. For example, in an IDE
// context, this might be a "compute all errors" query.
db.derived1(22); // The **sweep** phase: discard anything that was not traced during
// the mark phase.
db.sweep_all(...); In the case of our example, when we execute sweep_all, it would collect derived2(44).

