The HasQueryGroup<G> struct a new trait added to the plumbing module. It is implemented by the database struct MyDatabase for every query group that MyDatabase supports. Its role is to offer methods that move back and forth between the context of the full database to the context of an individual query group : pub trait HasQueryGroup<G>: Database
where G: QueryGroup<Self>,
{ /// Access the group storage struct from the database. fn group_storage(db: &Self) -> &G::GroupStorage; /// "Upcast" a group key into a database key. fn database_key(group_key: G::GroupKey) -> Self::DatabaseKey;
} Here the "database key" is an enum that contains variants for each group. Its role is to take group key and puts it into the context of the entire database.
